import React from "react";
import group7left from "../../images/footer/group7left.webp";
import group7right from "../../images/footer/group7right.webp";
import footerLeft from "../../images/footer/footerLeft.webp";

const Footer = () => {
  return (
    <div className="bg-[#313244] lg:bg-white text-center">
      <div className="flex mx-4 justify-evenly">
        <div className="w-1/3">
          <img className="w-[60px]" src={group7left} alt="" />
          <img src={footerLeft} alt="" />
        </div>
        <div className="">
          <p className="text-white font-extrabold text-xs lg:text-black">
            Licensed By WeAbove
          </p>
        </div>
        <div className="w-1/3">
          {/* <div className="pl-[90%]"> */}
          <img className="w-[60px] ml-[78%]" src={group7right} alt="" />
          {/* </div> */}
          <img src={footerLeft} alt="" />
        </div>
      </div>
      <span className="text-[#fc4a6a]">Terms & Conditions</span>
    </div>
  );
};

export default Footer;
